import api from './api'

class FornecedoresService {
  async getAllFornecedoress() {
    const response = await api.get('/api/fornecedores/')
    return response.data
  }
  async saveFornecedores(fornecedores) {
    const response = await api.post('/api/fornecedores/', fornecedores)
    return response.data
  }
  async deleteFornecedores(fornecedores) {
    const response = await api.delete(`/api/fornecedores/${fornecedores.id}/`)
    return response.data
  }
}

export default new FornecedoresService()
